'use strict';(function(){const indexCfg={cache:true};indexCfg.doc={id:'id',field:['title','content'],store:['title','href','section'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/pinouts/boards/','title':"Boards",'section':"Pinouts",'content':"Boards\r#\r\rAll of the supported boards are grouped by Manufacturer.\nSimply select the Manufacturer of your board below to view all boards by that Manufacturer.\n Arduino  "});index.add({'id':1,'href':'/pinouts/boards/arduino/','title':"Arduino",'section':"Boards",'content':"Arduino\r#\r\rBoards\r#\r\r Arduino Uno Arduino Leonardo (Coming Soon) Arduino Micro (Coming Soon) Arduino Nano (Coming Soon)  "});index.add({'id':2,'href':'/pinouts/boards/arduino/uno/','title':"Uno",'section':"Arduino",'content':"Arduino Uno\r#\r\rBoard Specifications\r#\r\r\r\rMicrocontroller\rATmega328P\r\r\rIO Voltage\r5V\r\r\rInput Voltage / VIN\r7-12V\r\r\rDigital IO Pins\r14\r\r\rPWM IO Pins\r6\r\r\rAnalog IO Pins\r6\r\r\rMax Current per Pin\r20mA\r\r\rClock Speed\r16MHz\r\r\rLength\r68.6mm\r\r\rWidth\r53.4mm\r\r\rHeight\r13mm\r\r\rWeight\r25g\r\r\rPinout\r#\r\r\nD0 - D13\r#\r\rThe Uno board has a total of 14 Digital IO pins. Pins 3, 5, 6, 9, 10 and 11 have Hardware PWM Capability. Each pin can only output up to 40mA max. (Only recommended up to 20mA). The total current provided by all pins together can only reach up to 200mA!\nA0 / A1 / A2 / A3 / A4 / A5\r#\r\rThe Uno board has a total of 6 Analog Input pins provided by a internal ADC (Analog to Digital Converter) These pins mainly serve as Analog inputs, but can be used as standard Digital IO Pins.\nSDA / SCL\r#\r\rThese pins are dedicated to I2C Communication.\nAREF\r#\r\rAnalog Reference. Provides a voltage reference for Analog Inputs.\nIOREF\r#\r\rInput / Output Reference. Provides a voltage reference with which the microcontroller operates.\nRESET\r#\r\rBringing this pin to a logical LOW will cause the microcontroller to reset.\n+3V3\r#\r\rThis pin provides regulated 3.3V to power components.\n+5V\r#\r\rThis pin provides regulated 5V to power components. (It is possible- but not recommended- to feed 5V in via this pin.)\nVIN\r#\r\rThe UNO board can be powered by 5-20 volts, however Arduino recommends to only use between 7-12 volts. Over this range can make the regulator overheat, and below this range may simply not be enough for the board to run.\n"});})();